//import ERC721 interface
import "./ERC721.sol";
// SPDX-License-Identifier: MIT
pragma solidity >=0.6.0 <0.8.0;
pragma experimental ABIEncoderV2;

//implement
contract ArtFundsStorage is ERC721 {
    // this contract's token collection name
    string public collectionName;
    // this contract's token symbol
    string public collectionNameSymbol;
    address payable public ARTFUNDS;
    struct Collection {
        uint256 tokenId;
        string imageURL;
        string name;
        string description;
    }

    uint256 public collectionCounter = 0;
    mapping(address => Collection[]) public ownerCollections;

    struct DigitalItem {
        uint256 tokenId;
        uint256 collectionID;
        string name;
        uint256 price;
        string itemURL;
        address payable mintedBy;
        address payable currentOwner;
        // address payable previousOwner;
        uint256 numberOfTransfers;
        bool forSale;
    }

    uint256 public digitalItemCounter;
    mapping(address => DigitalItem[]) public ownerDigitalItems;

    mapping(uint256 => DigitalItem) public listAllDigitalItem;

    mapping(uint256 => Collection) public listAllCollection;

    event ItemCreated(
        uint256 id,
        uint256 belongByColID,
        string name,
        address mintedBy,
        address currentOwner,
        uint256 price,
        string itemURL,
        uint256 numberOfTransfers,
        bool forSale
    );

